void proc_control::proc_control_eul2quat(const real_T eul[3], real_T q[4])
{
  real_T c_idx_0;
  real_T c_idx_1;
  real_T c_idx_2;
  real_T c_tmp;
  real_T c_tmp_idx_0;
  real_T c_tmp_idx_1;
  real_T q_tmp;
  real_T q_tmp_0;
  c_tmp = eul[0] / 2.0;
  c_idx_0 = c_tmp;
  c_tmp_idx_0 = c_tmp;
  c_tmp = eul[1] / 2.0;
  c_idx_1 = c_tmp;
  c_tmp_idx_1 = c_tmp;
  c_tmp = eul[2] / 2.0;
  c_idx_0 = std::cos(c_idx_0);
  c_tmp_idx_0 = std::sin(c_tmp_idx_0);
  c_idx_1 = std::cos(c_idx_1);
  c_tmp_idx_1 = std::sin(c_tmp_idx_1);
  c_idx_2 = std::cos(c_tmp);
  c_tmp = std::sin(c_tmp);
  q_tmp = c_idx_0 * c_idx_1;
  q_tmp_0 = c_tmp_idx_0 * c_tmp_idx_1;
  q[0] = q_tmp * c_idx_2 + q_tmp_0 * c_tmp;
  q[1] = q_tmp * c_tmp - q_tmp_0 * c_idx_2;
  q_tmp = c_tmp_idx_0 * c_idx_1;
  q_tmp_0 = c_idx_0 * c_tmp_idx_1;
  q[2] = q_tmp_0 * c_idx_2 + q_tmp * c_tmp;
  q[3] = q_tmp * c_idx_2 - q_tmp_0 * c_tmp;
}

