void proc_control::proc_control_quaternionBase_log(real_T q_a, real_T q_b,
  real_T q_c, real_T q_d, real_T *b_q_a, real_T *b_q_b, real_T *b_q_c, real_T
  *b_q_d)
{
  real_T qnorm;
  real_T vnorm;
  real_T vscale_data;
  real_T z_data;
  int32_T vscale_size[2];
  int32_T z_size[2];
  int32_T b_i;
  int32_T nx;
  int32_T trueCount;
  vnorm = std::sqrt((q_b * q_b + q_c * q_c) + q_d * q_d);
  qnorm = std::sqrt(q_a * q_a + vnorm * vnorm);
  trueCount = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      trueCount++;
    }
  }

  b_i = 0;
  if (vnorm != 0.0) {
    for (nx = 0; nx < 1; nx++) {
      b_i++;
    }
  }

  z_size[0] = 1;
  z_size[1] = b_i;
  for (nx = 0; nx < b_i; nx++) {
    z_data = q_a / qnorm;
  }

  vscale_size[0] = 1;
  vscale_size[1] = b_i;
  if (b_i - 1 >= 0) {
    vscale_data = z_data;
  }

  nx = b_i - 1;
  for (b_i = 0; b_i <= nx; b_i++) {
    vscale_data = std::acos(vscale_data);
  }

  if (z_size[1] == trueCount) {
    trueCount = z_size[1] - 1;
    vscale_size[0] = 1;
    for (nx = 0; nx <= trueCount; nx++) {
      vscale_data /= vnorm;
    }
  } else {
    pr_binary_expand_op_pr351ewpk3k(&vscale_data, vscale_size, vnorm, trueCount);
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    z_size[0] = 1;
    z_size[1] = nx;
    if (vscale_size[1] - 1 >= 0) {
      z_data = q_b * vscale_data;
    }
  } else {
    pro_binary_expand_op_pr351ewpk3(&z_data, z_size, q_b, nx, &vscale_data,
      vscale_size);
  }

  *b_q_d = q_b;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = z_data;
    }
  }

  *b_q_b = *b_q_d;
  if (!(vnorm != 0.0)) {
    *b_q_b = 0.0;
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    if (vscale_size[1] - 1 >= 0) {
      z_data = q_c * vscale_data;
    }
  } else {
    pro_binary_expand_op_pr351ewpk3(&z_data, z_size, q_c, nx, &vscale_data,
      vscale_size);
  }

  *b_q_d = q_c;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = z_data;
    }
  }

  *b_q_c = *b_q_d;
  if (!(vnorm != 0.0)) {
    *b_q_c = 0.0;
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    trueCount = vscale_size[1] - 1;
    for (nx = 0; nx <= trueCount; nx++) {
      vscale_data *= q_d;
    }
  } else {
    proc_binary_expand_op_pr351ewpk(&vscale_data, vscale_size, q_d, nx);
  }

  *b_q_d = q_d;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = vscale_data;
    }
  }

  if (!(vnorm != 0.0)) {
    *b_q_d = 0.0;
  }

  *b_q_a = std::log(qnorm);
}

quaternion_proc_control_T proc_control::proc_computeFirstQuatDerivative(real_T
  pn_a, real_T pn_b, real_T pn_c, real_T pn_d, real_T qn_a, real_T qn_b, real_T
  qn_c, real_T qn_d, real_T sd, real_T qinterp_a, real_T qinterp_b, real_T
  qinterp_c, real_T qinterp_d)
{
  quaternion_proc_control_T qdot;
  real_T y_a;
  real_T y_b;
  real_T y_c;
  real_T y_d;
  proc_control_quaternionBase_log(((pn_a * qn_a - -pn_b * qn_b) - -pn_c * qn_c)
    - -pn_d * qn_d, ((pn_a * qn_b + -pn_b * qn_a) + -pn_c * qn_d) - -pn_d * qn_c,
    ((pn_a * qn_c - -pn_b * qn_d) + -pn_c * qn_a) + -pn_d * qn_b, ((pn_a * qn_d
    + -pn_b * qn_c) - -pn_c * qn_b) + -pn_d * qn_a, &y_a, &y_b, &y_c, &y_d);
  qdot.a = (((qinterp_a * y_a - qinterp_b * y_b) - qinterp_c * y_c) - qinterp_d *
            y_d) * sd;
  qdot.b = (((qinterp_a * y_b + qinterp_b * y_a) + qinterp_c * y_d) - qinterp_d *
            y_c) * sd;
  qdot.c = (((qinterp_a * y_c - qinterp_b * y_d) + qinterp_c * y_a) + qinterp_d *
            y_b) * sd;
  qdot.d = (((qinterp_a * y_d + qinterp_b * y_c) - qinterp_c * y_b) + qinterp_d *
            y_a) * sd;
  return qdot;
}

